import Layout from '../components/layout';
import { Drawer, makeStyles } from '@material-ui/core';

const drawerWidth = 240;
const useStyles = makeStyles(theme => ({
  root: {
    display: 'flex'
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0
  },
  drawerPaper: {
    width: drawerWidth
  }
}));

export default function() {
  return (
    <React.Fragment>
      <Layout>
        <Drawer variant="permanent"></Drawer>
      </Layout>
    </React.Fragment>
  );
}
